description:
Verenigde Staten
Misdaad
82 minuten

geregisseerd door Jessy Terrero
met 50 Cent, Val Kilmer en AnnaLynne McCord

Rich (50 cent) en Angel (Val Kilmer) zijn twee vrienden wier vriendschap op de proef gesteld wordt als ze betrokken raken bij de illegale wapenhandel. We volgen de wapens van producent tot verkooppunt om vervolgens, na gekocht te zijn door de consument, in de handen van de verkeerde mensen te vallen.

Vertaald door het DRT Vertaalteam
Smokey91, Kable, Eppo en Fija

